create table activity_log
(
    id           bigint unsigned auto_increment
        primary key,
    log_name     varchar(255)                 null,
    description  text                         not null,
    subject_type varchar(255)                 null,
    event        varchar(255)                 null,
    subject_id   bigint unsigned              null,
    causer_type  varchar(255)                 null,
    causer_id    bigint unsigned              null,
    properties   longtext collate utf8mb4_bin null
        check (json_valid(`properties`)),
    batch_uuid   char(36)                     null,
    created_at   timestamp                    null,
    updated_at   timestamp                    null
)
    collate = utf8mb4_unicode_ci;

create index activity_log_log_name_index
    on activity_log (log_name);

create index causer
    on activity_log (causer_type, causer_id);

create index subject
    on activity_log (subject_type, subject_id);

